import React from "react";

export default function Homepage() {
  return (
    <div className="homepage">
      <div className="container-fluid">
        <div className="row">
          <div className="col-md-6 p-0 ">
            <img src="./images/banner_image.jpg" alt="" className="img-fluid" />
          </div>
        </div>
      </div>
    </div>
  );
}
